import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <h1>Movie Ticket System</h1>
        <p className="text-muted">By Justin, Stewart, Robbie, Florian, and Fizzah</p>
      </div>
    </div>
  );
}
